import React from 'react'

function ImageGalleryDesktop({object}) {

    let newArr = [];

    for (let i = 0; i < 5; i++) {
        newArr.push(object[0].images[i])
      } 

      console.log(newArr);
  return (
    <div className='imageGalleryDesk'>
        {newArr.map(e => {
            <div><img src={e} /></div>
        })}
    </div>
  )
}

export default ImageGalleryDesktop
